import React from 'react';

class Login extends React.Component {

  render() {
    return (
      <fieldset>
        <input 
          type="text"
          data-testid="email-input"
        />
        <input 
          type="text"
          data-testid="password-input"
        />
        <button type="submit" disabled>Entrar</button>
      </fieldset>
    )
  }
}

export default Login;
